import React from "react";
import "./styles.css";

function Card(props) {
  return (
    <div
      className={`card ${props.alignment}`}
      key={props.uniqueKey}
      style={{ float: props.alignment }}
    >
      <div className="gif">
        <iframe
          src={props.url}
          style={{
            width: "100%",
            height: "90%",
            border: "none",
          }}
        ></iframe>
      </div>
      <h2 className="name">{props.name}</h2>
    </div>
  );
}

export default Card;
